Here is one way to implement a queue data structure using two stacks in Python:

```python
class Queue:

    def __init__(self):
        self.in_stack = []
        self.out_stack = []

    def enqueue(self, item):
        self.in_stack.append(item)

    def dequeue(self):
        if len(self.in_stack) == 0:
            raise Exception("Queue is empty")
        item = self.in_stack[-1]
        self.in_stack.pop()
        self.out_stack.append(item)

    def peek(self):
        if len(self.in_stack) == 0:
            raise Exception("Queue is empty")
        return self.in_stack[-1]

    def is_empty(self):
        return len(self.in_stack) == 0
```

The queue is implemented using two stacks - an input stack to hold new items being added, and an output stack to hold the next item to be removed. The `enqueue` method pushes to the input stack, while `dequeue` pops from the input stack and pushes to the output stack. The `peek` method just returns the top of the input stack. The queue is empty when the input stack is empty.

