Here is a Python program to find the nth Fibonacci number using dynamic programming:

```python
def fib(n):
    if n <= 1:
        return n
    else:
        return fib(n-1) + fib(n-2)

num = 5
print(fib(num))
```

This implements recursion to find the nth Fibonacci number. The base cases are when n <= 1, in which case the Fibonacci numbers are just 0 and 1. For larger values of n, it recursively calls itself on the next smaller values n-1 and n-2 to calculate the Fibonacci numbers. This implements dynamic programming by memoizing the results to avoid recalculating the same values repeatedly.

For example, for n=5 the program calculates 0 + 1 = 1, then 1 + 1 = 2, then 2 + 3 = 5. It will memoize the result 5 so it doesn't have to recalculate 2 + 3. This speeds up the calculation compared to naive recursion where it would calculate 0 + 1 = 1, 1 + 1 = 2, 2 + 1 = 3, 3 + 2 = 5. By memoizing the results, it only has to calculate 2 + 3 = 5 once.
